// import { useState, useEffect } from 'react';

const navigation = ({ cast, onChoice }) => {
    return (
        <nav className="columbus">
            <ul>
                <li>
                    <details role="list">
                        <summary aria-haspopup="listbox" role="listitem">Home</summary>
                        <ul role="listbox">
                            {
                                cast.map(member => (
                                    <li key={member.id}>
                                        <a onClick={() => {onChoice(member)} }></a>
                                    </li>
                                )

                                )
                            }
                        </ul>
                    </details>
                </li>
            </ul>
        </nav>
    )
}

export default navigation;
